window.bookSummaryJSON = "<p>Hailed as a major talent in paranormal romance, Nalini Singh takes us deeper into the world of the Psy and the changelings in her latest extraordinary novel, where a gifted woman sees passion in her future---a passion that is absolutely forbidden by her kind. In danger from the Psy, Faith NightStar's fragile sanity will be tested by an all-consuming passion for a changeling who can take the form of man or jaguar.</p>"; 
